def renamed_files(file_mapping):
    fid_mapping = {} #fid, set(file path)
    for f, fid in file_mapping.items():
        if fid in fid_mapping:
            fid_mapping[fid].add(f)
        else:
            fid_mapping[fid] = set()
            fid_mapping[fid].add(f)
    fids = [f for f in fid_mapping if len(fid_mapping[f])>1]
    return fids

